import store from "../../store/store";
import { registerGroupCall } from "../wssConnection/wssConnection";

let mypeer;
let peerID;

export const connectWithPeer = () => {
    mypeer = new window.Peer(undefined, {
        path: '/peerjs',
        host: '/',
        port: '5000'
    });

    mypeer.on('open', (id) => {
        peerID = id;
        console.log(`Succesfully connected with peer server with id: ${id}`);
    });
};

export const createGroupCall = () => {
    registerGroupCall({
        username: store.getState().call.username
    })
}
